      menu.notify("Wait a sec", "AprioScript private ver", 2, 190)
    end
    system.yield(10)
    entity.set_entity_coords_no_offset(player.get_player_ped(player.player_id()), location)
  end)

menu.add_feature("int vehicle pool crash protection", "toggle", cages, function(feat)
    if feat.on then
    local limit = 10  
    for i in ipairs(vehicle.get_all_vehicles())do    
      local veh = vehicle.get_all_vehicles()[i]  
      if entity.get_entity_model_hash(veh) ~= nil then
        network.request_control_of_entity(veh)
entity.delete_entity(veh)
      end
      if (entity.get_entity_model_hash(veh) > limit) 
      and ped.get_vehicle_ped_is_using(player.get_player_ped(player.player_id())) ~= veh then
        local pos = entity.get_entity_coords(veh)
        pos.y = 20000
        network.request_control_of_entity(veh)
        entity.delete_entity(veh)
    for i in ipairs(vehicle.get_all_vehicles())do
      local veh = vehicle.get_all_vehicles()[i]
      if entity.is_entity_dead(veh) then
        local pos = entity.get_entity_coords(veh)
        pos.y = 20000
        network.request_control_of_entity(veh)
entity.delete_entity(veh)
    end
end
end
end
    end
    return HANDLER_CONTINUE
    end)

