  -----------------------------------------------------------------------------------------------------
  
local function OnEmotePlay(EmoteName)
    local InVehicle = ped.is_ped_in_any_vehicle(player.get_player_ped(-1), true)
    -- if not Config.AllowedInCars and InVehicle == 1 then
    --   return
    -- end
  
    if not entity.is_an_entity(player.get_player_ped(-1)) then
      return false
    end
  
    -- if Config.DisarmPlayer then
    --     SetCurrentPedWeapon(player.get_player_ped(-1), gameplay.get_hash_key('WEAPON_UNARMED'), true)
    -- end
  
    ChosenDict,ChosenAnimation,ename = table.unpack(EmoteName)
    AnimationDuration = -1
  
    if PlayerHasProp then
      DestroyAllProps()
    end
  
    -- if ChosenDict == "Expression" then 
    --   SetFacialIdleAnimOverride(player.get_player_ped(-1), ChosenAnimation, 0) --2take1 dont have this native yet
    --   return
    -- end
  
    if ChosenDict == "MaleScenario" or "Scenario" then 
      local PlayerGender = CheckGender()
      local pped = player.get_player_ped(-1)
      if ChosenDict == "MaleScenario" then if InVehicle then return end
        if PlayerGender == "male" then
          ped.clear_ped_tasks_immediately(pped)
          ai.task_start_scenario_in_place(pped, ChosenAnimation, 0, true)
          print("Playing scenario = ("..ChosenAnimation..")")
          IsInAnimation = true
        else
          SendNotif("This emote is for male only")
        end return
      elseif ChosenDict == "ScenarioObject" then if InVehicle then return end
        --local BehindPlayer = GetOffsetFromEntityInWorldCoords(pped, 0.0, 0 - 0.5, -0.5); --2take1 dont have this native yet (replaced with playercoords for now)
        ped.clear_ped_tasks_immediately(pped)
        ai.task_start_scenario_at_position(pped, ChosenAnimation, entity.get_entity_coords(pped) - v3(0.0, 0.0, 0.5), entity.get_entity_heading(pped), 0, true, false)
        print("Playing scenario = ("..ChosenAnimation..")")
        IsInAnimation = true
        return
      elseif ChosenDict == "Scenario" then if InVehicle then return end
        ped.clear_ped_tasks_immediately(pped)
        ai.task_start_scenario_in_place(pped, ChosenAnimation, 0, true)
        print("Playing scenario = ("..ChosenAnimation..")")
        IsInAnimation = true
      return end 
    end
  
    LoadAnim(ChosenDict)
  
    if EmoteName.AnimationOptions then
      if EmoteName.AnimationOptions.EmoteLoop then
        MovementType = 1
      if EmoteName.AnimationOptions.EmoteMoving then
        MovementType = 51
    end
  
    elseif EmoteName.AnimationOptions.EmoteMoving then
      MovementType = 51
    elseif EmoteName.AnimationOptions.EmoteMoving == false then
      MovementType = 0
    elseif EmoteName.AnimationOptions.EmoteStuck then
      MovementType = 50
    end
  
    else
      MovementType = 0
    end
  
    if InVehicle == 1 then
      MovementType = 51
    end

    local AttachWait = 0
    if EmoteName.AnimationOptions then
      if EmoteName.AnimationOptions.EmoteDuration == nil then 
        EmoteName.AnimationOptions.EmoteDuration = -1
        AttachWait = 0
      else
        AnimationDuration = EmoteName.AnimationOptions.EmoteDuration
        AttachWait = EmoteName.AnimationOptions.EmoteDuration
      end
  
    --   if EmoteName.AnimationOptions.PtfxAsset then
    --     PtfxAsset = EmoteName.AnimationOptions.PtfxAsset
    --     PtfxName = EmoteName.AnimationOptions.PtfxName
    --     if EmoteName.AnimationOptions.PtfxNoProp then
    --       PtfxNoProp = EmoteName.AnimationOptions.PtfxNoProp
    --     else
    --       PtfxNoProp = false
    --     end
    --     Ptfx1, Ptfx2, Ptfx3, Ptfx4, Ptfx5, Ptfx6, PtfxScale = table.unpack(EmoteName.AnimationOptions.PtfxPlacement)
    --     PtfxInfo = EmoteName.AnimationOptions.PtfxInfo
    --     PtfxWait = EmoteName.AnimationOptions.PtfxWait
    --     PtfxNotif = false
    --     PtfxPrompt = true
    --     PtfxThis(PtfxAsset)
    --   else
    --     SendNotif("Ptfx = none")
    --     PtfxPrompt = false
    --   end
    end
  
    ai.task_play_anim(player.get_player_ped(-1), ChosenDict, ChosenAnimation, 2.0, 2.0, AnimationDuration, MovementType, 0, false, false, false)
    streaming.remove_anim_dict(ChosenDict)
    IsInAnimation = true
  
    if EmoteName.AnimationOptions then
      if EmoteName.AnimationOptions.Prop then
          PropName = EmoteName.AnimationOptions.Prop
          PropBone = EmoteName.AnimationOptions.PropBone
          PropPl1, PropPl2, PropPl3, PropPl4, PropPl5, PropPl6 = table.unpack(EmoteName.AnimationOptions.PropPlacement)
          if EmoteName.AnimationOptions.SecondProp then
            SecondPropName = EmoteName.AnimationOptions.SecondProp
            SecondPropBone = EmoteName.AnimationOptions.SecondPropBone
            SecondPropPl1, SecondPropPl2, SecondPropPl3, SecondPropPl4, SecondPropPl5, SecondPropPl6 = table.unpack(EmoteName.AnimationOptions.SecondPropPlacement)
            SecondPropEmote = true
          else
            SecondPropEmote = false
          end
          system.wait(AttachWait)
          AddPropToPlayer(PropName, PropBone, PropPl1, PropPl2, PropPl3, PropPl4, PropPl5, PropPl6)
          if SecondPropEmote then
            AddPropToPlayer(SecondPropName, SecondPropBone, SecondPropPl1, SecondPropPl2, SecondPropPl3, SecondPropPl4, SecondPropPl5, SecondPropPl6)
          end
      end
    end
    return true
end

