local function playDance(n)
    local dance_ceil = #e_dances

    if not n or type(n) ~= "number" then
        n = math.random(dance_ceil)
        while e_dances[n] and e_dances[n].disabled do 
            n = math.random(dance_ceil)
            system.yield(0)
        end
        SendNotif("You randomly selected dance #"..n.."\nYou can play this dance again using /dance "..n)
    end

    if n > dance_ceil or n <= 0 then
        SendNotif("There are only "..dance_ceil.." dances, select a number inbetween or random (no input)")
        return
    end 

    if e_dances[n] and e_dances[n].disabled then
        SendNotif("Dance "..n.." is disabled")
        return
    end

    LoadAnim(e_dances[n].dict)
    ai.task_play_anim(player.get_player_ped(-1), e_dances[n].dict, e_dances[n].anim, 3.0, 3.0, -1, 1, 0, false, false, false)
    IsInAnimation = true
    streaming.remove_anim_dict(e_dances[n].dict)
end

